using UnityEngine;using System.Collections.Generic;public class ConfFact{    public static void Register()    {        DialogConfig.Init();        EffectConfig.Init();        GameBouquetsConfig.Init();        GameDailyTaskConfig.Init();        GameGuideConfig.Init();        GameInitConfig.Init();        GDailyTaskGiftConfig.Init();        GuiConfig.Init();        IPConfig.Init();        LuckDrawConfig.Init();        RepConfig.Init();        RoleConfig.Init();        SoundConfig.Init();        StrConfig.Init();        TalkConfig.Init();    }        public static bool ResLoaded()    {        if(!DialogConfig.resLoaded)            return false;        if(!EffectConfig.resLoaded)            return false;        if(!GameBouquetsConfig.resLoaded)            return false;        if(!GameDailyTaskConfig.resLoaded)            return false;        if(!GameGuideConfig.resLoaded)            return false;        if(!GameInitConfig.resLoaded)            return false;        if(!GDailyTaskGiftConfig.resLoaded)            return false;        if(!GuiConfig.resLoaded)            return false;        if(!IPConfig.resLoaded)            return false;        if(!LuckDrawConfig.resLoaded)            return false;        if(!RepConfig.resLoaded)            return false;        if(!RoleConfig.resLoaded)            return false;        if(!SoundConfig.resLoaded)            return false;        if(!StrConfig.resLoaded)            return false;        if(!TalkConfig.resLoaded)            return false;        return true;    }}